import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function VizNavigation() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container>
      <Navbar.Brand href="#home">Home</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className='my-home'>
            <Nav.Link href="#home"></Nav.Link>
          </Nav>
          <Nav className=''>
          <Nav.Link href="#categorical" component={Categorical} />
          </Nav>
          <Route path="/gender-violence" component={GenderCrimes} />
          <Route path="/gender-crime-against-crime-overall" component={GenderCrimesVsNonGenderCrimes} />
          <Route path="/income-and-crime" component={IncomeRelatedVariables} />
          <Route path="/time-series-analysis" component={TimeSeries} />
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default VizNavigation;
